sys_variable_value.value:
(function execute(inputs, outputs) {
    var password = Math.random().toString(36).slice(2) + Math.random().toString(36).slice(2).toUpperCase();

  outputs.password = gs.base64Encode(password);
  outputs.plain_text = password;
  
  
  var gr = new GlideRecord('sys_user');
  
  gr.user_name = inputs.user_name;
  gr.first_name = inputs.first_name;
  gr.last_name = inputs.last_name;
  gr.email = inputs.email;
  
  gr.user_password.setDisplayValue(password);

  var sys_id = gr.insert();

  outputs.sysid = sys_id;

 
 
 
 })(inputs, outputs);

